full_hex_str = ''

frame_size = 74

def split_hex_str(hex_str, frame_size):
    return [hex_str[i:i+frame_size*2] for i in range(0, len(hex_str), frame_size*2)]

splited_hex_string = split_hex_str(full_hex_str, frame_size)

for i in splited_hex_string:
    print(i)

